Description:
Throughout these lessons we'll be working with the set goal of sculpting a realistic elephant.

We'll start with creating a proportional base, blocking in anatomical landmarks, properly using reference material, problem solving and finally creating details. All this and much more will be explored in this advanced ZBrush course.

By the end of this training you should have an excellent method of dissecting a subject and transforming it into a 3D sculpt.
